INSERT INTO `abc_ant_messages` (`id`, `priority`, `start_date`, `end_date`, `viewed_date`, `viewed`, `title`, `description`, `html`, `url`, `language_code`, `date_modified`) VALUES
('abantecart_share_word', 1, '0000-00-00 00:00:00', '2029-12-31 18:00:00', '0000-00-00 00:00:00', 0, 'Help us making AbanteCart #1', '', '<p class="p1">Help AbanteCart community grow and provide better eCommerce for everyone. Let the world know about AbanteCart and your experience. Simply share a word on your favorite social media, blogs or forums</p>\r\n<strong></strong>', '', '*', '2015-11-06 17:30:52'),
('capterra_review', 1, '0000-00-00 00:00:00', '2029-12-31 18:00:00', '0000-00-00 00:00:00', 0, 'Please review AbanteCart and share your experience', '', 'Do you like <strong>AbanteCart</strong>? Please rate AbanteCart or share your experience with other eCommerce entrepreneurs. Go to <strong><a href="http://www.capterra.com/ecommerce-software/spotlight/126413/AbanteCart/AbanteCart" target="_blank">Capterra rating page</a></strong> to add your rating or <strong><a href="http://www.capterra.com/ecommerce-software/reviews/126413/AbanteCart/AbanteCart/new" target="_blank">write a review</a></strong>', '', '*', '2015-11-06 17:30:52'),
('banner', 1, '2011-09-16 00:54:47', '2029-12-31 18:00:00', '2015-11-06 17:30:56', 1, 'Banner at AbanteCart header', '', '<strong>AbanteCart</strong> V1.2.4 is a current application version. New in this release: Admin UI improvments and system condition check <strong><a href="http://www.abantecart.com/shopping-cart-news/abantecart-124-released" target="_blank">Learn more ... </a></strong>', 'http://www.abantecart.com', '*', '2015-11-06 17:30:56');
