(154, 1, 1, 'default_fedex_default_fedex', 'default_fedex_note', 'To obtain your Meter Number and Authorization Key, you will need to follow these steps:</br>\n            Go to <a href="http://fedex.com/us/developer" target="_blank">http://fedex.com/us/developer</a><br>\n            Login in with FedEx username and password or click Register Now if they don''t have one.<br>\n            Click "Technical Resources" (left side).<br>\n            Under that click "FedEx web services for shipping.<br>\n            Click on "Move To Production" (right side).<br>\n            Scroll down to button and click "Obtain Production Key".<br>\n            On form choose "No" on question 1.<br>\n            Check the first box on question 2.<br>\n            Choose "Corporate Developer" on question 3.<br>\n            Accept agreement.<br>\n            Fill out the form (do not use dashes in the account number).<br>\n            Receive meter number and key instantly.  Your Production Password will be emailed to you once you complete the above steps.', '2015-11-06 17:27:31', '2015-11-06 17:27:31'),
