(798, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_duplicate_key', 'Error: Selected key name pair already exists!', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(799, 1, 1, 'encryption_data_manager_encryption_data_manager', 'encryption_data_manager_note', '  <b>This extension requires ADVANCED configuration and attention</b><br/> \n		  <b>Once enabled and data encrypted, there is NO undo and extension can not be disabled! </b><br/> \n		  This extension helps managing encryption keys creation and data migration from open to encrypted tables (initial migration)<br/> \n		  <b>PLEASE NOTE:</b> you need to have <b>PHP 5.3</b> or grater with SSL Encryption  <b>ENABLED</b>\n          <br/>\n          <br/>To enable data encryption please read help instructions (Help button above)', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(800, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_openssl_disabled', 'Warning: OpenSSL for PHP is not available or not activated. You can not use encryption or this extension! <br> Check HELP for this extension for more details.', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(801, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_data_encryption_disabled', 'Warning: Data Encryption is not enabled on your AbanteCart. You can not encrypt/decrypt data using this extension! <br> Check HELP for this extension for more details.', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(802, 1, 1, 'encryption_data_manager_encryption_data_manager', 'key_gen_section_name', 'Generate Key Pair', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
