(804, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_required_data_missing', 'Missing required data field(s). Please check provided values', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(805, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_key_name', 'Unique key pair name:<br /><span class="help">Name should not contain any spaces or special characters. Keeps it short and simple.</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(806, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_key_length', 'Key length (bits):<br /><span class="help">Specify key encryption bit length. Larger number represent stronger encryption, but can slower performance (Range 256 - 8192 )</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(807, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_private_key_type', 'Ecncryption type:<br /><span class="help">This is an encryption algorithm. Use default RSA if you are not advanced user.</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(808, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_encrypt_key', 'Enable password based key:<br /><span class="help">If enable, addtional passphrase will be required to decrypt text with use of private key. NOTE. This is not currently supported in data encryption.</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(809, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_passphrase', 'Passphrase or key password:<br /><span class="help">Remember the passphrase or key(s) will be useless and data might be lost</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(810, 1, 1, 'encryption_data_manager_encryption_data_manager', 'text_success_key_get', '<b>Key pair has been created. See keys below and keep them safe.</b> <br/><br/> %s <br/><br/> %s ', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(811, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_generating_keys_failed', 'Key pair generation failed. Check your settings and check error log.', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(812, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_enc_key', 'Key pair name:<br /><span class="help">Select key to be used for encryption. IMPORTANT: Remember key that you used</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(813, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_enc_tables', 'Table(s) to encrypt:<br /><span class="help">Shown table(s) will be encryted with the key selected. Data can only be opened with this key</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(814, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_enc_test_mode', 'Test Mode:<br /><span class="help">Check first that all is OK to be encrepted.</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(815, 1, 1, 'encryption_data_manager_encryption_data_manager', 'entry_enc_remove_original', 'Remove source data:<br /><span class="help">Remove source un-encrepted data records after encryption is complete</span>', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(816, 1, 1, 'encryption_data_manager_encryption_data_manager', 'text_success_encrypting', '<b>Data has been encrypted. <br />  See details:</b> <br/><br/> %s <br /><br /> <b>If you want this key to be used for new data encryption, add following line to file system/config.php : define(''DATA_ENCRYPTION_KEYPAIR'', ''%s''); </b> ', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(817, 1, 1, 'encryption_data_manager_encryption_data_manager', 'text_encryption_test', '<b>Data encryption test result</b> Check error log for any possible errors! <br/><br/> %s ', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(818, 1, 1, 'encryption_data_manager_encryption_data_manager', 'error_encrypting', 'Data encryption failed. Check your settings and check error log.', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
(819, 1, 1, 'encryption_data_manager_encryption_data_manager', 'post_encrypting_notice', '<b>Important notes! After encryption is completed data will be copied to mirror tables with data encrypted in them. \n    		<br />Follow instructions to add configuration to system/config.php for AbanteCart to switch read/write operations to encrypted tables. </b><br /> Add following line to configuration file: define(''DATA_ENCRYPTION_KEYPAIR'', ''your_key_name''); <br> This will be default key for read/write operations ', '2015-11-06 17:27:33', '2015-11-06 17:27:33'),
