(1491, 1, 1, 'common_quick_start', 'text_quick_start', 'Quick Start Wizard', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1492, 1, 1, 'common_quick_start', 'text_quick_start_note', '    	Welcome to AbanteCart administration.<br />\n    	This is a wizard to help you quickly set up your shopping cart with most common settings.\n		<br />\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1493, 1, 1, 'common_quick_start', 'text_quick_start_general', '    	Below are most common general settings. \n    	More settings are available <a href="%s" target="_new_admin"><i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1494, 1, 1, 'common_quick_start', 'text_quick_start_details', '    	Below are most common settings about your store. \n    	More settings are available <a href="%s" target="_new_admin"><i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1495, 1, 1, 'common_quick_start', 'text_quick_start_checkout', '    	Below are most common settings for checkout process. \n    	More settings are available <a href="%s" target="_new_admin"><i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1496, 1, 1, 'common_quick_start', 'text_quick_start_appearance', '    	Below are most common settings for storefront appearance. \n    	More settings are available <a href="%s" target="_new_admin"><i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1497, 1, 1, 'common_quick_start', 'text_quick_start_mail', '    	Below are most common settings to enable email. If you use external email server (google, etc) to send emails, you need to use SMTP option. For emails to be sent from this server use Mail option. \n    	More settings are available <a href="%s" target="_new_admin"><i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1498, 1, 1, 'common_quick_start', 'text_quick_start_last', '    	Bellow you can select desired payments and shipping methods, additional languages and many other features to extend your eCommerce functionality.\n    	Remember to check a selection of extensions on <a href="#admin#rt=extension/extensions_store" target="_extension">AbanteCart marketplace</a> offered by community of professional developers.\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1499, 1, 1, 'common_quick_start', 'text_quick_start_last_footer', '    	You have completed quick starter wizard. <br /><br /> \n    	You can locate all the settings <a href="%s">this link <i class="fa fa-link fa-fw"></i></a>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1500, 1, 1, 'common_quick_start', 'payments_selection', '    <div class="info alert alert-info">\n    <i class="fa fa-money fa-fw"></i> Select your payment methods.\n    </div>\n    <div class="row">\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_stripe" target="_extension">\n	        <img src="extensions/default_stripe/image/icon.png"><br>Install Stripe</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_pp_standart" target="_extension">\n	        <img src="extensions/default_pp_standart/image/icon.png"><br>Install Paypal</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_payza" target="_extension">\n	        <img src="extensions/default_payza/image/icon.png"><br>Install Payza</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/payment" target="_extension">\n	        <img src="admin/view/default/image/default_extension.png"><br>More Payments</a>\n	    </div>\n    </div>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1501, 1, 1, 'common_quick_start', 'shipping_selection', '    <div class="info alert alert-info">\n    <i class="fa fa-truck fa-fw"></i> Select your shipping methods.\n    </div>\n    <div class="row">\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_free_shipping" target="_extension">\n	        <img src="extensions/default_free_shipping/image/icon.png"><br>Free shipping</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_fedex" target="_extension">\n	        <img src="extensions/default_fedex/image/icon.png"><br>Fedex</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_ups" target="_extension">\n	        <img src="extensions/default_ups/image/icon.png"><br>UPS</a>\n	    </div>\n	    <div class="col-sm-3 h5 center">\n	        <a href="#admin#rt=extension/extensions/shipping" target="_extension">\n	        <img src="admin/view/default/image/default_extension.png"><br>More Shippings</a>\n	    </div>\n    </div>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1502, 1, 1, 'common_quick_start', 'language_selection', '    <div class="info alert alert-info">\n    <i class="fa fa-language fa-fw"></i> Select additional langauges.\n    </div>\n    <div class="row">\n	    <div class="col-sm-4 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_spanish" target="_extension">\n	        <img src="extensions/default_spanish/image/icon.png"><br>Spanish</a>\n	    </div>\n	    <div class="col-sm-4 h5 center">\n	        <a href="#admin#rt=extension/extensions/install&extension=default_russian" target="_extension">\n	        <img src="extensions/default_russian/image/icon.png"><br>Russian</a>\n	    </div>\n	    <div class="col-sm-4 h5 center">\n	        <a href="#admin#rt=extension/extensions_store&category_id=67&sidx=date_modified" target="_extension">\n	        <img src="admin/view/default/image/default_extension.png"><br>More Languages</a>\n	    </div>\n    </div>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
(1503, 1, 1, 'common_quick_start', 'more_extentions', '    <div class="info alert alert-info">\n    <i class="fa fa-puzzle-piece fa-fw"></i> More extensions on AbanteCart marketplace.\n    </div>\n    <div class="row center">\n		<div class="btn-group center">\n		    <a class="btn btn-primary" href="#admin#rt=extension/extensions_store" target="_extension">\n		    	<i class="fa fa-cloud-download fa-fw"></i> Extensions Marketplace\n		    </a>\n		</div>\n    </div>\n    ', '2015-11-06 17:27:34', '2015-11-06 17:27:34'),
