(2635, 1, 1, 'setting_setting', 'entry_translate_method', 'Text Translation Method:<br /><span class="help">Select method you want to use for translation. Default method is a straight copy of source language text</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2636, 1, 1, 'setting_setting', 'entry_translate_override_existing', 'Override if source language text was changed:<br /><span class="help">If set, text in all languages will be replaced with new translation if source language text is edited. NOTE: Can cause many translations.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2637, 1, 1, 'setting_setting', 'entry_warn_lang_text_missing', 'Warn for missing language text:<br /><span class="help">Get warning message if missing language text is detected.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
