(2646, 1, 1, 'setting_setting', 'entry_invoice_prefix', 'Invoice Prefix:<br /><span class="help">Set the invoice prefix e.g. IN/001</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
