(2648, 1, 1, 'setting_setting', 'entry_customer_price', 'Login Display Prices:<br /><span class="help">Show prices even if customer is not logged in.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2649, 1, 1, 'setting_setting', 'entry_customer_approval', 'Approve New Customers:<br /><span class="help">Don''t allow new customer to login until their account has been approved.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2650, 1, 1, 'setting_setting', 'entry_prevent_email_as_login', 'Require Login Name:<br /><span class="help">To improve security, require customers to create unique login name instead of using email address as login name. If set to ON, existing customers will be asked to create new login name at the first login. If OFF, login name is set as customer email address.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2651, 1, 1, 'setting_setting', 'entry_guest_checkout', 'Guest Checkout:<br /><span class="help">Allow customers to checkout without creating an account. This will not be available when a downloadable product is in the shopping cart.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2652, 1, 1, 'setting_setting', 'entry_account', 'Account Terms:<br /><span class="help">Forces people to agree to terms before an account can be created.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2653, 1, 1, 'setting_setting', 'entry_checkout', 'Checkout Terms:<br /><span class="help">Forces people to agree to terms before an a customer can checkout.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2654, 1, 1, 'setting_setting', 'entry_order_status', 'Order Status:<br /><span class="help">Set the default order status when an order is processed.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2655, 1, 1, 'setting_setting', 'entry_stock_display', 'Display Stock:<br /><span class="help">Display stock quantity on the product page.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2656, 1, 1, 'setting_setting', 'entry_nostock_autodisable', 'No Stock Auto Disable:<br /><span class="help">Disable your product or option value for view if stock drops to 0. Message notification will be send </span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2657, 1, 1, 'setting_setting', 'entry_stock_checkout', 'Stock Checkout:<br /><span class="help">Allow customers to still checkout if the products they are ordering are not in stock.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2658, 1, 1, 'setting_setting', 'entry_stock_status', 'Stock Status:<br /><span class="help">Default setting for out of stock status message for product. Used on product edit page.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
