(2698, 1, 1, 'setting_setting', 'entry_session_ttl', 'Control Panel Session Expiration:<br /><span class="help">This value controls time interval in minutes before you will be asked to login again due to no activity.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2699, 1, 1, 'setting_setting', 'entry_encryption', 'Encryption Key:<br /><span class="help">Setting migrated to config file starting in v1.2.1.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2700, 1, 1, 'setting_setting', 'entry_seo_url', 'Use SEO URL''s:<br /><span class="help">To use SEO URL''s apache module mod-rewrite must be installed and you need to rename the htaccess.txt to .htaccess. Note: If abantecart not installed in the root of domain must be changed rewriteBase rule inside .htaccess file.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2701, 1, 1, 'setting_setting', 'entry_retina_enable', 'Generate high-res (retina) images:<br /><span class="help">To use this apache module mod-rewrite must be installed and you need to rename the htaccess.txt to .htaccess. Note: If abantecart not installed in the root of domain must be changed rewriteBase rule inside .htaccess file. <br>After enabling should clear the cache images. </span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2702, 1, 1, 'setting_setting', 'entry_compression', 'Output Compression Level:<br /><span class="help">GZIP for more efficient transfer to requesting clients. Compression level must be between 0 - 9</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2703, 1, 1, 'setting_setting', 'entry_error_display', 'Display Errors:<br /><span class="help">Set to yes if you want to see the exceptions and errors</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2704, 1, 1, 'setting_setting', 'entry_error_log', 'Log Errors:<br /><span class="help">Set to yes if you want to save the exceptions and errors to the log</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2705, 1, 1, 'setting_setting', 'entry_enable_reviews', 'Enable Reviews:<br /><span class="help"></span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2706, 1, 1, 'setting_setting', 'entry_cache_enable', 'Cache enabled:<br /><span class="help">Please be careful when disable caching. Cached pages will not be re-created and site might start loading slow. </span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2707, 1, 1, 'setting_setting', 'entry_storefront_api_status', 'Storefront API status:', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2708, 1, 1, 'setting_setting', 'entry_storefront_api_key', 'Storefront API Key:<br /><span class="help">Set this key to provide restricted (more secure) access to storefront API.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2709, 1, 1, 'setting_setting', 'entry_storefront_api_stock_check', 'Storefront API Stock Access:<br /><span class="help">Enable if you allow storefront API to check stock availability</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2710, 1, 1, 'setting_setting', 'entry_admin_api_status', 'Admin API status:', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2711, 1, 1, 'setting_setting', 'entry_admin_api_key', 'Admin API Key:<br /><span class="help">Set this key to provide restricted (more secure) access to admin API.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2712, 1, 1, 'setting_setting', 'entry_admin_access_ip_list', 'Admin API Access IPs:<br /><span class="help">Provide list of IPs (comma separated) that will be allowed to access admin API. Other IPs will be blocked</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2713, 1, 1, 'setting_setting', 'entry_upload_max_size', 'Resource Library Upload Max File Size, kB', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2714, 1, 1, 'setting_setting', 'entry_debug', 'Show Debug Info:<br /><span class="help">Set this ON if you want to see the execution details and show debug details.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2715, 1, 1, 'setting_setting', 'entry_debug_0', 'Off', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2716, 1, 1, 'setting_setting', 'entry_debug_1', 'Show', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2717, 1, 1, 'setting_setting', 'entry_debug_2', 'Log', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2718, 1, 1, 'setting_setting', 'entry_debug_level', 'Debug Level:<br /><span class="help">Select the depth of the details you need to see in the debug output.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2719, 1, 1, 'setting_setting', 'entry_debug_level_0', 'Level 0 - no logs , only exception errors ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2720, 1, 1, 'setting_setting', 'entry_debug_level_1', 'Level 1 - errors and warnings', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2721, 1, 1, 'setting_setting', 'entry_debug_level_2', 'Level 2 - #1 + mysql site load, php file execution time and page elements load time ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2722, 1, 1, 'setting_setting', 'entry_debug_level_3', 'Level 3 - #2 + basic logs and stack of execution', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2723, 1, 1, 'setting_setting', 'entry_debug_level_4', 'Level 4 - #3 + dump mysql statements ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2724, 1, 1, 'setting_setting', 'entry_debug_level_5', 'Level 5 - #4 + intermediate variable ', '2015-11-06 17:27:37', '2015-11-06 17:27:37');
INSERT INTO `abc_language_definitions` (`language_definition_id`, `language_id`, `section`, `block`, `language_key`, `language_value`, `date_added`, `date_modified`) VALUES
(2725, 1, 1, 'setting_setting', 'entry_template_debug', 'Template debug:<br /><span class="help">Enable this setting if you need to check issues with template in storefront and control panel.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2726, 1, 1, 'setting_setting', 'entry_error_filename', 'Error Log Filename:<br /><span class="help">This is a file where errors are saved.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2727, 1, 1, 'setting_setting', 'entry_shipping_session', 'Use Shipping Session:<br /><span class="help">Saves shipping quotes to session to avoid re-quoting unnecessarily. Quotes will only be re-quoted if cart or address is changed.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2728, 1, 1, 'setting_setting', 'entry_catalog_limit', 'Default Items per Page (Storefront):<br /><span class="help">Sets how many storefront items are shown per page (products, categories, etc)</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2729, 1, 1, 'setting_setting', 'entry_admin_limit', 'Default Items per Page (Admin):<br /><span class="help">Sets how many admin items are shown per page in listing grids (orders, customers, etc)</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2730, 1, 1, 'setting_setting', 'entry_bestseller_limit', 'Number of Items In Bestseller Block ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2731, 1, 1, 'setting_setting', 'entry_featured_limit', 'Number of Items In Featured Block ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2732, 1, 1, 'setting_setting', 'entry_latest_limit', 'Number of Items In Latest Block ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2733, 1, 1, 'setting_setting', 'entry_special_limit', 'Number of Items In Special Block ', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2734, 1, 1, 'setting_setting', 'entry_cart_weight', 'Display Weight on Cart Page:<br /><span class="help">Show the cart weight on the cart page</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2735, 1, 1, 'setting_setting', 'entry_reviews', 'Allow Reviews:<br /><span class="help">Enable/Disable new review entry and display of existing reviews</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2736, 1, 1, 'setting_setting', 'entry_maintenance', 'Maintenance Mode:<br /><span class="help">Prevents customers from browsing your store. They will instead see a maintenance message. If logged in as admin, you will see the store as normal.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2737, 1, 1, 'setting_setting', 'entry_voicecontrol', 'Voice Control:<br /><span class="help">Enable admin voice control to activate voice commands feature. Currently only supported in Chrome version 25 or later.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2738, 1, 1, 'setting_setting', 'entry_help_links', 'Help Links:<br /><span class="help">If you want to see Help Icons and links to AbanteCart site. This will help you learn about features and how to use them. If you advanced user and do not want to see these help icons, you can disable.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2739, 1, 1, 'setting_setting', 'entry_show_tree_data', 'Enable Tree Grid:<br /><span class="help">Enables admin grids to show parent/children types in one grid listing. NOTE: Pagination and multi-actions are disabled for these grids</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2740, 1, 1, 'setting_setting', 'entry_cart_ajax', 'Same Page Add To Cart:<br /><span class="help">This will enable AJAX add to cart feature. Product can be added to cart without redirecting to cart page</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2741, 1, 1, 'setting_setting', 'entry_storefront_width', 'Storefront Site Width:<br /><span class="help">Example: 100% or 1000px </span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2742, 1, 1, 'setting_setting', 'entry_admin_width', 'Admin Site Width:<br /><span class="help">Example: 100% or 1000px </span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2743, 1, 1, 'setting_setting', 'entry_total_order_maximum', 'Maximum order amount allowed:<br /><span class="help">Prevent checkout with large order sub-total amounts. 0 = NO LIMIT</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2744, 1, 1, 'setting_setting', 'entry_total_order_minimum', 'Minimum order amount:<br /><span class="help">Prevent checkout if order sub-total does not reach minimum amount set. 0 = NO MINIMUM</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2745, 1, 1, 'setting_setting', 'entry_system_check', 'System Check:<br /><span class="help">Enable this setting if you want to check your system condition in respect to AbanteCart functionlaity. System issues effecting AbanteCart will be reported as messages visible in admin.</span>', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2746, 1, 1, 'setting_setting', 'button_add_store', 'New Store', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2747, 1, 1, 'setting_setting', 'error_permission', 'Warning: You do not have permission to modify settings!', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2748, 1, 1, 'setting_setting', 'error_loginname', 'Login name must be alphanumeric only and between 5 and 64 characters!', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
(2749, 1, 1, 'setting_setting', 'error_loginname_notunique', 'This login name is not available. Try different login name!', '2015-11-06 17:27:37', '2015-11-06 17:27:37'),
