(3733, 1, 0, 'account_success', 'text_approval', '<p>Thank you for registering with %s!</p><p>You will be notified by email once your account has been activated by the store owner.</p><p>If you have ANY questions about the operation of this online shop, please <a href="%s">contact the store owner</a>.</p>', '2015-11-06 17:27:41', '2015-11-06 17:27:41'),
(3734, 1, 0, 'account_success', 'text_activate', '<p>Thank you for registering with %s!</p><p>You will be notified by email about your account activation.</p><p>If you have ANY questions about the operation of this online shop, please <a href="%s">contact the store owner</a>.</p>', '2015-11-06 17:27:41', '2015-11-06 17:27:41'),
